import React, { useEffect, useState } from "react";
import classes from "./hero.module.css";

const Hero = () => {
  const URL1 =
    "http://www.themealdb.com/api/json/v1/1/filter.php?i=chicken_breast";
  const URL2 = "http://www.themealdb.com/api/json/v1/1/search.php?s=Burger";
  const [chickenRecipe, setChickenRecipe] = useState("");
  const [burgerRecipe, setBurgerRecipe] = useState("");

  useEffect(() => {
    const fetchChickenRecipe = async () => {
      try {
        const res = await fetch(URL1);
        const data = await res.json();

        setChickenRecipe(data.meals[0]);
      } catch (error) {
        console.log(error);
      }
    };
    fetchChickenRecipe();
  }, []);

  useEffect(() => {
    const fetchBurgerRecipe = async () => {
      try {
        const res = await fetch(URL2);
        const data = await res.json();

        setBurgerRecipe(data.meals[0]);
      } catch (error) {
        console.log(error);
      }
    };
    fetchBurgerRecipe();
  }, []);
  return <div>Hero</div>;
};

export default Hero;
